import React, { useEffect, useState } from 'react';

const PlayerPicksPage = () => {
  const [week, setWeek] = useState(1);
  const [games, setGames] = useState([]);
  const [selectedPicks, setSelectedPicks] = useState([]);
  const [playerName, setPlayerName] = useState('');
  const [deadlinePassed, setDeadlinePassed] = useState(false);

  useEffect(() => {
    fetch(`http://localhost:4000/api/games?week=${week}`)
      .then(res => res.json())
      .then(data => setGames(data))
      .catch(err => console.error('Error loading games:', err));
  }, [week]);

  const handlePick = (team) => {
    if (selectedPicks.includes(team)) {
      setSelectedPicks(selectedPicks.filter(t => t !== team));
    } else if (selectedPicks.length < 10) {
      setSelectedPicks([...selectedPicks, team]);
    }
  };

  const handleSubmit = () => {
    if (selectedPicks.length !== 10 || !playerName) return;

    fetch('http://localhost:4000/api/picks', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name: playerName, picks: selectedPicks, week }),
    })
      .then(res => res.json())
      .then(() => alert('Picks submitted!'))
      .catch(err => console.error('Submission error:', err));
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h2>Weekly Picks</h2>

      <div style={{ marginBottom: '10px' }}>
        <label>Choose Week: </label>
        <select value={week} onChange={(e) => setWeek(Number(e.target.value))}>
          {[...Array(16)].map((_, i) => (
            <option key={i + 1} value={i + 1}>Week {i + 1}</option>
          ))}
        </select>
      </div>

      <input
        type="text"
        placeholder="Enter your game name"
        value={playerName}
        onChange={(e) => setPlayerName(e.target.value)}
        style={{ padding: '5px', marginBottom: '10px', display: 'block' }}
      />

      {deadlinePassed ? (
        <p style={{ color: 'red' }}>The pick deadline has passed. You can no longer submit picks.</p>
      ) : (
        <>
          <table border="1" cellPadding="8" style={{ width: '100%', marginBottom: '10px' }}>
            <thead>
              <tr>
                <th>Date</th>
                <th>Time</th>
                <th>Teams & Spread</th>
                <th>Pick</th>
              </tr>
            </thead>
            <tbody>
              {games.map((game, idx) => (
                <tr key={idx}>
                  <td>{game.date}</td>
                  <td>{game.time}</td>
                  <td>{game.team1} {game.spread} {game.team2}</td>
                  <td>
                    <button onClick={() => handlePick(game.team1)}>
                      {selectedPicks.includes(game.team1) ? '✅' : 'Pick'} {game.team1}
                    </button>
                    <button onClick={() => handlePick(game.team2)} style={{ marginLeft: '5px' }}>
                      {selectedPicks.includes(game.team2) ? '✅' : 'Pick'} {game.team2}
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <button onClick={handleSubmit} disabled={selectedPicks.length !== 10 || !playerName}>
            Submit Picks
          </button>
        </>
      )}
    </div>
  );
};

export default PlayerPicksPage;
